import React from "react";
import "./movie.css";
const MovieCards = (props) => {
  console.log("dream", props);
  return (
    <div class="main">
      <div>
        {" "}
        <div class="card">
          <h2>{props.name}</h2>
          <p>{props.rating}</p>
          <p>{props.release_Date}</p>
        </div>
      </div>
    </div>
  );
};

export default MovieCards;
